"use client";

import { useEffect } from "react";

import { getBasePath } from "../_lib/basePath";

const BASE_PATH = getBasePath();

type NextData = {
  assetPrefix?: string;
};

function getNextData(): NextData | undefined {
  return (window as Window & { __NEXT_DATA__?: NextData }).__NEXT_DATA__;
}

export default function AssetPrefixCheck() {
  useEffect(() => {
    const basePath = BASE_PATH && BASE_PATH !== "/" ? BASE_PATH.replace(/\/$/, "") : "";
    const assetPrefix = getNextData()?.assetPrefix;
    if (assetPrefix && basePath && !assetPrefix.startsWith(basePath)) {
      console.warn(
        "[inspecta] assetPrefix mismatch:",
        { basePath, assetPrefix }
      );
    }

    const asset = document.querySelector(
      'script[src*="/_next/"], link[rel="stylesheet"][href*="/_next/"]'
    );
    const assetUrl =
      asset instanceof HTMLScriptElement
        ? asset.src
        : asset instanceof HTMLLinkElement
        ? asset.href
        : "";
    if (assetUrl && basePath && !assetUrl.includes(`${basePath}/_next/`)) {
      console.warn("[inspecta] asset URL not under basePath:", assetUrl);
    }
  }, []);

  return null;
}

"use client";

import {
  useCallback,
  useId,
  useState,
  type KeyboardEvent,
  type MouseEvent,
  type ReactNode,
} from "react";

type CollapsiblePanelProps = {
  eyebrow?: string;
  title: ReactNode;
  subhead?: string;
  actions?: ReactNode;
  children: ReactNode;
  defaultOpen?: boolean;
  titleAs?: "h1" | "h2" | "h3";
  collapsible?: boolean;
};

export default function CollapsiblePanel({
  eyebrow,
  title,
  subhead,
  actions,
  children,
  defaultOpen = false,
  titleAs = "h2",
  collapsible = true,
}: CollapsiblePanelProps) {
  const [isOpen, setIsOpen] = useState(defaultOpen);
  const contentId = useId();
  const isCollapsible = collapsible;

  const isExpanded = isCollapsible ? isOpen : true;

  const handleToggle = useCallback(() => {
    setIsOpen((prev) => !prev);
  }, []);

  const handleHeaderClick = useCallback(
    (event: MouseEvent<HTMLDivElement>) => {
      if (!isCollapsible) {
        return;
      }
      const target = event.target as HTMLElement | null;
      if (!target) {
        handleToggle();
        return;
      }

      if (target.closest("a, button, input, textarea, select")) {
        return;
      }

      handleToggle();
    },
    [handleToggle, isCollapsible]
  );

  const handleHeaderKeyDown = useCallback(
    (event: KeyboardEvent<HTMLDivElement>) => {
      if (!isCollapsible) {
        return;
      }
      if (event.key === "Enter" || event.key === " ") {
        event.preventDefault();
        handleToggle();
      }
    },
    [handleToggle, isCollapsible]
  );

  const TitleTag = titleAs;

  return (
    <section
      className={`provenance-panel panel-collapsible ${
        isExpanded ? "expanded" : "collapsed"
      }`}
    >
      <div
        className="panel-header panel-collapsible-header"
        onClick={isCollapsible ? handleHeaderClick : undefined}
        onKeyDown={isCollapsible ? handleHeaderKeyDown : undefined}
        role={isCollapsible ? "button" : undefined}
        tabIndex={isCollapsible ? 0 : undefined}
        aria-expanded={isCollapsible ? isExpanded : undefined}
        aria-controls={isCollapsible ? contentId : undefined}
      >
        <div>
          {eyebrow && <p className="panel-eyebrow">{eyebrow}</p>}
          <TitleTag className="panel-title">{title}</TitleTag>
          {subhead && <p className="panel-subhead">{subhead}</p>}
        </div>
        <div className="panel-collapsible-actions" data-panel-interactive="true">
          {actions}
          {isCollapsible && !isExpanded && (
            <button
              type="button"
              className="panel-collapse-toggle"
              onClick={(event) => {
                event.stopPropagation();
                handleToggle();
              }}
              aria-expanded={isExpanded}
              aria-controls={contentId}
            >
              Expand
            </button>
          )}
        </div>
      </div>
      <div id={contentId} className="panel-collapsible-body">
        {children}
      </div>
    </section>
  );
}

"use client";

import { useEffect, useMemo, useState } from "react";

import type { MintedCube } from "../_data/minted-cube";
import FallbackImage from "./FallbackImage";
import CubixlesLogo from "./CubixlesLogo";
import CubixlesText from "./CubixlesText";

type CubeProvenanceExplorerProps = {
  cube: MintedCube;
  requestedTokenId: string;
};

function truncateMiddle(value: string, start = 6, end = 4) {
  if (value.length <= start + end + 3) {
    return value;
  }
  return `${value.slice(0, start)}...${value.slice(-end)}`;
}

function getOpenSeaCollectionUrl(explorerUrl?: string | null): string | null {
  if (!explorerUrl) {
    return null;
  }

  try {
    const url = new URL(explorerUrl);
    if (!url.hostname.includes("opensea.io")) {
      return null;
    }

    const segments = url.pathname.split("/").filter(Boolean);
    if (!segments.length) {
      return null;
    }

    if (segments[0] === "collection" && segments[1]) {
      return `${url.origin}/collection/${segments[1]}`;
    }

    if (segments[0] === "assets" && segments[1] && segments[2]) {
      return `${url.origin}/assets/${segments[1]}/${segments[2]}`;
    }

    if (segments[0] === "assets" && segments[1]) {
      return `${url.origin}/assets/${segments[1]}`;
    }
  } catch {
    return null;
  }

  return null;
}

function getMediaCandidates(media?: MintedCube["media"]) {
  if (media?.imageCandidates?.length) {
    return media.imageCandidates;
  }
  if (media?.image) {
    return [media.image];
  }
  return [];
}

export default function CubeProvenanceExplorer({
  cube,
  requestedTokenId,
}: CubeProvenanceExplorerProps) {
  const [selectedFaceId, setSelectedFaceId] = useState<string | null>(
    cube.provenanceNFTs[0]?.faceId ?? null
  );

  useEffect(() => {
    setSelectedFaceId(cube.provenanceNFTs[0]?.faceId ?? null);
  }, [cube.tokenId, cube.provenanceNFTs]);

  const selectedFace = useMemo(
    () =>
      cube.provenanceNFTs.find((nft) => nft.faceId === selectedFaceId) ??
      cube.provenanceNFTs[0],
    [cube.provenanceNFTs, selectedFaceId]
  );

  const isMismatch = cube.tokenId !== requestedTokenId;
  const truncatedCubeTokenId = truncateMiddle(cube.tokenId);
  const selectedFaceCollectionUrl = selectedFace
    ? getOpenSeaCollectionUrl(selectedFace.explorerUrl)
    : null;

  return (
    <section className="minted-cube-panel">
      <div className="minted-cube-panel-heading">
        <div>
          <p className="panel-eyebrow">Minted cube inspector</p>
          <h2
            className="panel-title"
            title={`cubixles_ #${cube.tokenId}`}
          >
            Investigating <CubixlesLogo className="cubixles-logo-inline" /> #
            {truncatedCubeTokenId}
          </h2>
          <p className="panel-subhead">
            <CubixlesText text={cube.description} />
          </p>
          {isMismatch && (
            <p className="panel-note" title={cube.tokenId}>
              Showing the verified cube for {truncatedCubeTokenId} because that is the
              actual token minted at this position in the series.
            </p>
          )}
        </div>
        <div className="minted-cube-meta">
          <span>Minted {cube.mintedAt}</span>
          <span>{cube.network}</span>
          <span>{cube.mintedBy}</span>
        </div>
      </div>

      <div className="minted-cube-links">
        {cube.tokenViewUrl && (
          <a
            href={cube.tokenViewUrl}
            target="_blank"
            rel="noreferrer"
            className="landing-button primary"
          >
            Open mint gallery
          </a>
        )}
        {cube.references.map((reference) => (
          <a
            key={reference.url}
            href={reference.url}
            target="_blank"
            rel="noreferrer"
            className="landing-button tertiary"
          >
            {reference.label}
          </a>
        ))}
      </div>

      <div className="minted-cube-media">
        <div className="minted-cube-media-frame">
          <FallbackImage
            candidates={getMediaCandidates(cube.media)}
            alt={`Cubixles ${cube.tokenId} media`}
            className="minted-cube-media-image"
            placeholderClassName="minted-cube-media-placeholder"
            placeholderLabel="No cube image resolved"
          />
          {cube.media?.animation && (
            <a
              href={cube.media.animation}
              target="_blank"
              rel="noreferrer"
              className="minted-cube-media-link"
            >
              View animation
            </a>
          )}
        </div>
        <div className="minted-cube-media-caption">
          <span className="panel-face-label">
            <CubixlesLogo className="cubixles-logo-inline" /> media
          </span>
          <span
            className="minted-cube-media-id"
            title={cube.tokenId}
          >
            Token {truncatedCubeTokenId}
          </span>
        </div>
      </div>

      <div className="provenance-explorer-heading">
        <p className="panel-eyebrow">Provenance NFTs</p>
        <p className="panel-subhead">
          <CubixlesText text={cube.provenanceNote} />
        </p>
      </div>

      <div className="provenance-face-tabs">
        {cube.provenanceNFTs.map((nft) => (
          <button
            key={nft.faceId}
            type="button"
            className={`provenance-tab ${
              selectedFaceId === nft.faceId ? "active" : ""
            }`}
            onClick={() => setSelectedFaceId(nft.faceId)}
          >
            Face {nft.faceId}
          </button>
        ))}
      </div>

      {selectedFace && (
        <div className="provenance-face-detail">
          <div className="provenance-face-media">
            <FallbackImage
              candidates={getMediaCandidates(selectedFace.media)}
              alt={`${selectedFace.collection} ${selectedFace.tokenId}`}
              className="provenance-face-image"
              placeholderClassName="provenance-face-placeholder"
              placeholderLabel="No face image resolved"
            />
            {selectedFace.media?.animation && (
              <a
                href={selectedFace.media.animation}
                target="_blank"
                rel="noreferrer"
                className="provenance-media-link"
              >

                View animation
              </a>
            )}
          </div>
          <div className="provenance-face-info">
            <div className="provenance-card-header">
              <span className="panel-face-label">Face {selectedFace.faceId}</span>
              <span className="panel-ref-title">{selectedFace.title}</span>
            </div>
            <p className="provenance-card-description">
              <CubixlesText text={selectedFace.description} />
            </p>
            <div className="provenance-card-meta">
              <span title={selectedFace.contractAddress ?? selectedFace.collection}>
                {selectedFace.collection}
              </span>
              <span title={selectedFace.tokenId}>
                Token {truncateMiddle(selectedFace.tokenId)}
              </span>
            </div>
            <p className="panel-note">{selectedFace.ownerNote}</p>
            <div className="provenance-card-links">
              {selectedFace.explorerUrl && (
                <a
                  href={selectedFace.explorerUrl}
                  target="_blank"
                  rel="noreferrer"
                  className="mint-audit-reference"
                >
                  View on-chain
                </a>
              )}
              {selectedFaceCollectionUrl && (
                <a
                  href={selectedFaceCollectionUrl}
                  target="_blank"
                  rel="noreferrer"
                  className="mint-audit-reference"
                >
                  OpenSea collection
                </a>
              )}
              {selectedFace.metadataUrl && (
                <a
                  href={selectedFace.metadataUrl}
                  target="_blank"
                  rel="noreferrer"
                  className="mint-audit-reference"
                >
                  Metadata snapshot
                </a>
              )}
            </div>
          </div>
        </div>
      )}

      <div className="provenance-grid">
        {cube.provenanceNFTs.map((nft) => {
          const collectionUrl = getOpenSeaCollectionUrl(nft.explorerUrl);
          return (
            <article
              key={`${cube.tokenId}-${nft.faceId}`}
              className={`provenance-card ${
                selectedFaceId === nft.faceId ? "provenance-card-highlight" : ""
              }`}
            >
              <div className="provenance-card-media">
                <FallbackImage
                  candidates={getMediaCandidates(nft.media)}
                  alt={`${nft.collection} ${nft.tokenId}`}
                  className="provenance-card-image"
                  placeholderClassName="provenance-card-placeholder"
                  placeholderLabel="No face image resolved"
                />
              </div>
              <div className="provenance-card-header">
                <span className="panel-face-label">Face {nft.faceId}</span>
                <span className="panel-ref-title">{nft.title}</span>
              </div>
              <p className="provenance-card-description">{nft.description}</p>
              <div className="provenance-card-meta">
                <span title={nft.contractAddress ?? nft.collection}>
                  {nft.collection}
                </span>
                <span title={nft.tokenId}>
                  Token {truncateMiddle(nft.tokenId)}
                </span>
              </div>
              <p className="panel-note">{nft.ownerNote}</p>
              <div className="provenance-card-links">
                {nft.explorerUrl && (
                  <a
                    href={nft.explorerUrl}
                    target="_blank"
                    rel="noreferrer"
                    className="mint-audit-reference"
                  >
                    View on-chain
                  </a>
                )}
                {collectionUrl && (
                  <a
                    href={collectionUrl}
                    target="_blank"
                    rel="noreferrer"
                    className="mint-audit-reference"
                  >
                    OpenSea collection
                  </a>
                )}
                {nft.metadataUrl && (
                  <a
                    href={nft.metadataUrl}
                    target="_blank"
                    rel="noreferrer"
                    className="mint-audit-reference"
                  >
                    Metadata snapshot
                  </a>
                )}
              </div>
            </article>
          );
        })}
      </div>

      <div className="provenance-trail">
        <div className="provenance-trail-heading">
          <p className="panel-eyebrow">Full provenance trail</p>
          <p className="panel-subhead">
            A staged account of how the cube was built, referenced, and sealed on-chain.
          </p>
        </div>
        <ol className="provenance-trail-list">
          {cube.provenanceTrail.map((step, index) => (
            <li key={`${cube.tokenId}-${step.title}`}>
              <span className="panel-face-label">Stage {index + 1}</span>
              <p className="panel-ref-title">{step.title}</p>
              <p className="panel-body-text">{step.detail}</p>
              {step.reference && (
                <a
                  href={step.reference.url}
                  target="_blank"
                  rel="noreferrer"
                  className="mint-audit-reference"
                >
                  {step.reference.label}
                </a>
              )}
            </li>
          ))}
        </ol>
      </div>
    </section>
  );
}

type CubixlesLogoProps = {
  className?: string;
};

export default function CubixlesLogo({ className }: CubixlesLogoProps) {
  return (
    <span className={["cubixles-logo", className].filter(Boolean).join(" ")}>
      <span aria-hidden="true">{CUBIXLES_LOGO_GLYPH}</span>
      <span className="sr-only">{CUBIXLES_LOGO_TEXT}</span>
    </span>
  );
}

"use client";

import { Fragment } from "react";
import CubixlesLogo from "./CubixlesLogo";

type CubixlesTextProps = {
  text: string;
  className?: string;
};

const LOGO_TOKEN = /cubixles_/gi;

export default function CubixlesText({ text, className }: CubixlesTextProps) {
  const parts = text.split(LOGO_TOKEN);
  if (parts.length === 1) {
    return <span className={className}>{text}</span>;
  }

  return (
    <span className={className}>
      {parts.map((part, index) => (
        <Fragment key={`${part}-${index}`}>
          {part}
          {index < parts.length - 1 && (
            <CubixlesLogo className="cubixles-logo-inline" />
          )}
        </Fragment>
      ))}
    </span>
  );
}

"use client";

import { useEffect, useId, useState } from "react";

export default function DigItOverlay() {
  const [isOpen, setIsOpen] = useState(false);
  const titleId = useId();

  useEffect(() => {
    if (!isOpen) {
      return;
    }

    const previousOverflow = document.body.style.overflow;
    document.body.style.overflow = "hidden";

    const handleKeyDown = (event: KeyboardEvent) => {
      if (event.key === "Escape") {
        setIsOpen(false);
      }
    };

    document.addEventListener("keydown", handleKeyDown);

    return () => {
      document.removeEventListener("keydown", handleKeyDown);
      document.body.style.overflow = previousOverflow;
    };
  }, [isOpen]);

  return (
    <>
      <button
        type="button"
        className="landing-button secondary landing-button-dig"
        onClick={() => setIsOpen(true)}
      >
        Dig it
      </button>
      {isOpen && (
        <div className="dig-overlay" role="dialog" aria-modal="true" aria-labelledby={titleId}>
          <button
            type="button"
            className="dig-overlay-backdrop"
            aria-label="Close overlay"
            onClick={() => setIsOpen(false)}
          />
          <div className="dig-overlay-panel">
            <div className="dig-overlay-header">
              <h2 className="dig-overlay-title" id={titleId}>
                Contextualized Rarity as Inversion
              </h2>
              <button
                type="button"
                className="dig-overlay-close"
                onClick={() => setIsOpen(false)}
              >
                Close
              </button>
            </div>
            <div className="dig-overlay-body">
              <p>
                NFT-native digital art forces a reconsideration of rarity. In a medium where
                images are infinitely replicable and traits are algorithmically enumerable,
                scarcity at the level of form is largely synthetic.
              </p>
              <p>
                Cubixles starts from a different premise: the only element that is
                conceptually rare in NFT space is contextualized provenance.
              </p>
              <div className="dig-overlay-staccato">
                <span>Images can be copied.</span>
                <span>Styles can be forked.</span>
                <span>Traits can be regenerated.</span>
              </div>
              <p>
                But the specific, verifiable context of ownership relations - who owned
                what, when, and how those works were brought into relation - is irreducible.
              </p>
              <p>Cubixles consolidates this insight into three aligned layers:</p>
              <dl className="dig-overlay-layers">
                <div>
                  <dt>Principle</dt>
                  <dd>
                    Rarity in NFTs does not emerge from visual uniqueness, but from
                    contextualized lineage - the historically specific configuration of
                    ownership and reference.
                  </dd>
                </div>
                <div>
                  <dt>Primitive</dt>
                  <dd>
                    Provenance itself becomes the creator market primitive: a composable,
                    ownership-verified relation between tokens.
                  </dd>
                </div>
                <div>
                  <dt>Mechanism</dt>
                  <dd>
                    The minting process binds the verifiable provenance of NFTs a user
                    already owns into a new token, making contextual rarity executable and
                    material.
                  </dd>
                </div>
              </dl>
              <p>
                In this framework, rarity is no longer a property of images or traits. It is
                a property of relations.
              </p>
            </div>
          </div>
        </div>
      )}
    </>
  );
}

type FallbackImageProps = {
  candidates?: string[];
  alt: string;
  className?: string;
  placeholderClassName?: string;
  placeholderLabel?: string;
};

export default function FallbackImage({
  candidates = [],
  alt,
  className,
  placeholderClassName,
  placeholderLabel = "No image resolved",
}: FallbackImageProps) {
  const [index, setIndex] = useState(0);
  const [failed, setFailed] = useState(false);
  const candidatesKey = useMemo(() => candidates.join("|"), [candidates]);

  useEffect(() => {
    setIndex(0);
    setFailed(false);
  }, [candidatesKey]);

  if (!candidates.length || failed) {
    return (
      <div className={placeholderClassName}>
        {placeholderLabel}
      </div>
    );
  }

  return (
    <img
      src={candidates[index]}
      alt={alt}
      className={className}
      loading="lazy"
      onError={() => {
        if (index < candidates.length - 1) {
          setIndex((prev) => prev + 1);
        } else {
          setFailed(true);
        }
      }}
    />
  );
}

type DiamondState = {
  x: number;
  y: number;
  vx: number;
  vy: number;
  rotation: number;
  vRotation: number;
};

const CUBE_LINKS = [
  { href: "https://nodefoundation.com/", label: "Open Node Foundation" },
  { href: "https://less.ripe.wtf/", label: "Open less.ripe.wtf" },
  { href: "https://studybook.eth.link", label: "Open Studybook" },
];
const CUBE_COUNT = CUBE_LINKS.length;
const CUBE_SIZE = 36;
const RUBIK_FACES = [
  [
    "#f6c933",
    "#f3f1e7",
    "#d4362a",
    "#1a5fd6",
    "#f6c933",
    "#1b9c53",
    "#f28c28",
    "#f6c933",
    "#1a5fd6",
  ],
  [
    "#1b9c53",
    "#f3f1e7",
    "#1a5fd6",
    "#f28c28",
    "#1b9c53",
    "#d4362a",
    "#f6c933",
    "#1b9c53",
    "#f28c28",
  ],
  [
    "#1a5fd6",
    "#f6c933",
    "#f3f1e7",
    "#d4362a",
    "#1a5fd6",
    "#f28c28",
    "#1b9c53",
    "#1a5fd6",
    "#d4362a",
  ],
];

function randomBetween(min: number, max: number) {
  return min + Math.random() * (max - min);
}

function createState(width: number, height: number): DiamondState {
  return {
    x: randomBetween(0, Math.max(0, width - CUBE_SIZE)),
    y: randomBetween(0, Math.max(0, height - CUBE_SIZE)),
    vx: randomBetween(-0.7, 0.7),
    vy: randomBetween(-0.7, 0.7),
    rotation: randomBetween(-12, 12),
    vRotation: randomBetween(-0.12, 0.12),
  };
}

export default function FloatingDiamonds() {
  const anchorsRef = useRef<(HTMLAnchorElement | null)[]>([]);
  const animationRef = useRef<number | null>(null);

  useEffect(() => {
    const nodes = anchorsRef.current.filter(
      (node): node is HTMLAnchorElement => Boolean(node)
    );
    if (!nodes.length) {
      return;
    }

    let width = window.innerWidth;
    let height = window.innerHeight;
    const states = nodes.map(() => createState(width, height));

    const animate = () => {
      width = window.innerWidth;
      height = window.innerHeight;

      nodes.forEach((node, index) => {
        const state = states[index];
        if (!state) {
          return;
        }

        state.x += state.vx;
        state.y += state.vy;
        state.rotation += state.vRotation;

        if (state.x > width + CUBE_SIZE) {
          state.x = -CUBE_SIZE;
        }
        if (state.x < -CUBE_SIZE) {
          state.x = width + CUBE_SIZE;
        }
        if (state.y > height + CUBE_SIZE) {
          state.y = -CUBE_SIZE;
        }
        if (state.y < -CUBE_SIZE) {
          state.y = height + CUBE_SIZE;
        }

        node.style.transform = `translate3d(${state.x}px, ${state.y}px, 0) rotate(${state.rotation}deg)`;
      });

      animationRef.current = window.requestAnimationFrame(animate);
    };

    const handleResize = () => {
      width = window.innerWidth;
      height = window.innerHeight;
    };

    window.addEventListener("resize", handleResize);
    animationRef.current = window.requestAnimationFrame(animate);

    return () => {
      window.removeEventListener("resize", handleResize);
      if (animationRef.current) {
        window.cancelAnimationFrame(animationRef.current);
      }
    };
  }, []);

  return (
    <>
      {Array.from({ length: CUBE_COUNT }).map((_, index) => {
