const DEFAULT_BASE_PATH = "/inspecta_deck";
const RAW_BASE_PATH = process.env.NEXT_PUBLIC_BASE_PATH ?? DEFAULT_BASE_PATH;
const BASE_PATH =
  RAW_BASE_PATH && RAW_BASE_PATH !== "/"
    ? RAW_BASE_PATH.replace(/\/$/, "")
    : DEFAULT_BASE_PATH;

export function withBasePath(path: string) {
  if (!BASE_PATH) {
    return path;
  }
  if (path.startsWith(BASE_PATH)) {
    return path;
  }
  return `${BASE_PATH}${path.startsWith("/") ? path : `/${path}`}`;
}

export function getBasePath() {
  return BASE_PATH;
}

type CacheAdapter = {
  get: (key: string) => Promise<string | null>;
  set: (key: string, value: string, ttlSeconds: number) => Promise<void>;
};

type MemoryEntry = {
  value: string;
  expiresAt: number;
};

const memoryCache = new Map<string, MemoryEntry>();
let adapterPromise: Promise<CacheAdapter> | null = null;
let redisClientPromise: Promise<any> | null = null;

function getNow(): number {
  return Date.now();
}

function createMemoryAdapter(): CacheAdapter {
  return {
    async get(key) {
      const entry = memoryCache.get(key);
      if (!entry) {
        return null;
      }
      if (entry.expiresAt <= getNow()) {
        memoryCache.delete(key);
        return null;
      }
      return entry.value;
    },
    async set(key, value, ttlSeconds) {
      const ttlMs = Math.max(ttlSeconds, 0) * 1000;
      memoryCache.set(key, { value, expiresAt: getNow() + ttlMs });
    },
  };
}

async function getRedisClient(redisUrl: string): Promise<any> {
  if (!redisClientPromise) {
    const { createClient } = await import("redis");
    const client = createClient({ url: redisUrl });
    client.on("error", () => {
      // Fail silently; callers will fall back to memory cache on errors.
    });
    redisClientPromise = client.connect().then(() => client);
  }
  return redisClientPromise;
}

async function createRedisAdapter(redisUrl: string): Promise<CacheAdapter> {
  return {
    async get(key) {
      const client = await getRedisClient(redisUrl);
      const value = await client.get(key);
      return value ?? null;
    },
    async set(key, value, ttlSeconds) {
      const client = await getRedisClient(redisUrl);
      const ttl = Math.max(ttlSeconds, 0);
      if (ttl > 0) {
        await client.setEx(key, ttl, value);
        return;
      }
      await client.set(key, value);
    },
  };
}

async function createVercelKvAdapter(): Promise<CacheAdapter> {
  const { kv } = await import("@vercel/kv");
  return {
    async get(key) {
      const value = await kv.get<string>(key);
      return value ?? null;
    },
    async set(key, value, ttlSeconds) {
      const ttl = Math.max(ttlSeconds, 0);
      if (ttl > 0) {
        await kv.set(key, value, { ex: ttl });
        return;
      }
      await kv.set(key, value);
    },
  };
}

async function getCacheAdapter(): Promise<CacheAdapter> {
  if (adapterPromise) {
    return adapterPromise;
  }

  const { cacheProvider, redisUrl } = getEnvConfig();

  adapterPromise = (async () => {
    if (cacheProvider === "redis" && redisUrl) {
      try {
        return await createRedisAdapter(redisUrl);
      } catch {
        return createMemoryAdapter();
      }
    }

    if (cacheProvider === "kv") {
      try {
        return await createVercelKvAdapter();
      } catch {
        return createMemoryAdapter();
      }
    }

    return createMemoryAdapter();
  })();

  return adapterPromise;
}

export async function getCachedJson<T>(
  key: string,
  ttlSeconds: number,
  fetcher: () => Promise<T>
): Promise<T> {
  const adapter = await getCacheAdapter();
  const cached = await adapter.get(key);
  if (cached) {
    try {
      return JSON.parse(cached) as T;
    } catch {
      // Ignore corrupted cache entries.
    }
  }

  const fresh = await fetcher();
  await adapter.set(key, JSON.stringify(fresh), ttlSeconds);
  return fresh;
}

type CacheTtls = {
  tokens: number;
  metadata: number;
  provenance: number;
  owners: number;
  verify: number;
};

export type EnvConfig = {
  alchemyKey: string;
  network: string;
  contractAddress: string;
  cacheProvider: string;
  redisUrl?: string;
  cacheTtls: CacheTtls;
};

const cachedConfigByChain = new Map<string, EnvConfig>();

const NETWORK_BY_CHAIN_ID: Record<number, string> = {
  1: "eth-mainnet",
  5: "eth-goerli",
  11155111: "eth-sepolia",
  137: "polygon-mainnet",
  80001: "polygon-mumbai",
  8453: "base-mainnet",
  84532: "base-sepolia",
};

function readEnv(name: string): string | undefined {
  const value = process.env[name];
  if (!value) {
    return undefined;
  }
  const trimmed = value.trim();
  return trimmed.length > 0 ? trimmed : undefined;
}

function requireEnv(names: string[], label: string): string {
  for (const name of names) {
    const value = readEnv(name);
    if (value) {
      return value;
    }
  }
  throw new Error(`Missing required env var: ${label}`);
}

function resolveChainId(chainIdOverride?: number): number | null {
  if (typeof chainIdOverride === "number" && Number.isFinite(chainIdOverride)) {
    return chainIdOverride;
  }
  const chainIdRaw = readEnv("CUBIXLES_CHAIN_ID") ?? readEnv("BASE_CHAIN_ID");
  if (chainIdRaw) {
    const chainId = Number.parseInt(chainIdRaw, 10);
    if (Number.isFinite(chainId)) {
      return chainId;
    }
  }
  return null;
}

function resolveNetwork(chainIdOverride?: number): string {
  const chainId = resolveChainId(chainIdOverride);
  if (chainId && NETWORK_BY_CHAIN_ID[chainId]) {
    return NETWORK_BY_CHAIN_ID[chainId];
  }
  const direct = readEnv("NETWORK");
  if (direct) {
    return direct;
  }
  throw new Error("Missing required env var: NETWORK");
}

function resolveContractAddress(chainIdOverride?: number): string {
  const chainId = resolveChainId(chainIdOverride);
  if (chainId === 8453) {
    const baseContract = readEnv("CUBIXLES_BASE_CONTRACT_ADDRESS");
    if (baseContract) {
      return baseContract;
    }
  }
  return requireEnv(
    ["CUBIXLES_CONTRACT", "CUBIXLES_CONTRACT_ADDRESS"],
    "CUBIXLES_CONTRACT"
  );
}

function parseNumberEnv(name: string, fallback: number): number {
  const raw = process.env[name];
  if (!raw) {
    return fallback;
  }
  const parsed = Number.parseInt(raw, 10);
  return Number.isFinite(parsed) ? parsed : fallback;
}

export function getEnvConfig(chainIdOverride?: number): EnvConfig {
  const chainId = resolveChainId(chainIdOverride);
  const cacheKey = chainId ? String(chainId) : "default";
  const cached = cachedConfigByChain.get(cacheKey);
  if (cached) {
    return cached;
  }

  const alchemyKey = requireEnv(["ALCHEMY_KEY", "ALCHEMY_API_KEY"], "ALCHEMY_KEY");
  const network = resolveNetwork(chainId);
  const contractAddress = resolveContractAddress(chainId);

  const config = {
    alchemyKey,
    network,
    contractAddress,
    cacheProvider: process.env.CACHE_PROVIDER ?? "memory",
    redisUrl: process.env.REDIS_URL,
    cacheTtls: {
      tokens: parseNumberEnv("CACHE_TTL_TOKENS", 600),
      metadata: parseNumberEnv("CACHE_TTL_METADATA", 86400),
      provenance: parseNumberEnv("CACHE_TTL_PROVENANCE", 600),
      owners: parseNumberEnv("CACHE_TTL_OWNERS", 600),
