function parseTokenBucketEntry(raw: string | null): TokenBucketEntry | null {
  if (!raw) {
    return null;
  }
  try {
    const parsed = JSON.parse(raw) as TokenBucketEntry;
    if (
      typeof parsed.tokens === "number" &&
      Number.isFinite(parsed.tokens) &&
      typeof parsed.lastRefill === "number" &&
      Number.isFinite(parsed.lastRefill)
    ) {
      return parsed;
    }
  } catch {
    // Ignore malformed entries.
  }
  return null;
}

export async function checkRateLimit(
  key: string,
  limit: number,
  windowMs: number
): Promise<{
  allowed: boolean;
  remaining: number;
  resetAt: number;
}> {
  const safeLimit = Math.max(1, limit);
  const safeWindowMs = Math.max(1000, windowMs);
  const store = await getRateLimitStore();
  const entry = await store.incr(key, safeWindowMs);
  return {
    allowed: entry.count <= safeLimit,
    remaining: Math.max(safeLimit - entry.count, 0),
    resetAt: entry.resetAt,
  };
}

export async function checkTokenBucket(
  key: string,
  capacity: number,
  windowMs: number
): Promise<{
  allowed: boolean;
  remaining: number;
  resetAt: number;
}> {
  const safeCapacity = Math.max(1, capacity);
  const safeWindowMs = Math.max(1000, windowMs);
  const refillRate = safeCapacity / safeWindowMs;
  const now = getNow();
  const store = await getRateLimitStore();

  const existing = parseTokenBucketEntry(await store.get(key));
  const entry = existing ?? {
    tokens: safeCapacity,
    lastRefill: now,
  };

  const elapsed = now - entry.lastRefill;
  const refilled = Math.min(safeCapacity, entry.tokens + elapsed * refillRate);
  const allowed = refilled >= 1;
  const remaining = allowed ? refilled - 1 : refilled;

  await store.set(
    key,
    JSON.stringify({
      tokens: remaining,
      lastRefill: now,
    }),
    Math.ceil(safeWindowMs * 2)
  );

  const resetAt = now + Math.ceil((safeCapacity - remaining) / refillRate);

  return {
    allowed,
    remaining: Math.max(Math.floor(remaining), 0),
    resetAt,
  };
}

export function getTrustedClientIp(request: Request): string {
  const vercelForwardedFor = request.headers.get("x-vercel-forwarded-for");
  if (vercelForwardedFor) {
    return vercelForwardedFor.split(",")[0]?.trim() ?? "unknown";
  }

  const realIp = request.headers.get("x-real-ip");
  if (realIp) {
    return realIp.trim();
  }

  const forwardedFor = request.headers.get("x-forwarded-for");
  if (forwardedFor) {
    return forwardedFor.split(",")[0]?.trim() ?? "unknown";
  }

  return "unknown";
}

export function encodeTokenIdToBase62(tokenId: string): string | null {
  try {
    let value = BigInt(tokenId);
    if (value < 0n) {
      return null;
    }
    if (value === 0n) {
      return BASE62_ALPHABET[0];
    }
    let output = "";
    while (value > 0n) {
      const remainder = value % BASE;
      output = BASE62_ALPHABET[Number(remainder)] + output;
      value /= BASE;
    }
    return output;
  } catch {
    return null;
  }
}

export function decodeBase62ToTokenId(value: string): string | null {
  if (!value || !/^[0-9A-Za-z]+$/.test(value)) {
    return null;
  }
  let output = 0n;
  for (const char of value) {
    const index = BASE62_ALPHABET.indexOf(char);
    if (index < 0) {
      return null;
    }
    output = output * BASE + BigInt(index);
  }
  return output.toString();
}

type VectorEntry = {
  id: string;
  embedding: Float32Array;
  norm: number;
};

type VectorIndex = {
  model: string;
  normalized: boolean;
  dims: number;
  vectors: VectorEntry[];
};

type ScoredResult = {
  id: string;
  score: number;
};

const VECTOR_PATH = path.join(process.cwd(), "kb", "vectors.json");
const DEFAULT_MODEL = "Xenova/all-MiniLM-L6-v2";

let indexPromise: Promise<VectorIndex | null> | null = null;
const embedderPromises = new Map<string, Promise<any>>();

function computeNorm(vector: Float32Array): number {
  let sum = 0;
  for (const value of vector) {
    sum += value * value;
  }
  return Math.sqrt(sum) || 1;
}

function dotProduct(a: Float32Array, b: Float32Array): number {
  const length = Math.min(a.length, b.length);
  let sum = 0;
  for (let i = 0; i < length; i += 1) {
    sum += a[i] * b[i];
  }
  return sum;
}

async function loadVectorIndex(): Promise<VectorIndex | null> {
  if (indexPromise) {
    return indexPromise;
  }

  indexPromise = (async () => {
    try {
      const raw = await fs.readFile(VECTOR_PATH, "utf8");
      const parsed = JSON.parse(raw) as {
        model?: string;
        normalized?: boolean;
        dims?: number;
        vectors?: Array<{ id?: string; embedding?: number[] }>;
      };

      const vectors: VectorEntry[] = [];
      const vectorList = Array.isArray(parsed.vectors) ? parsed.vectors : [];
      const normalized = parsed.normalized !== false;
      const model = typeof parsed.model === "string" ? parsed.model : DEFAULT_MODEL;

      for (const entry of vectorList) {
        if (!entry || typeof entry.id !== "string" || !Array.isArray(entry.embedding)) {
          continue;
        }
        const embedding = Float32Array.from(entry.embedding.map((value) => Number(value)));
        if (!embedding.length || embedding.some((value) => Number.isNaN(value))) {
          continue;
        }
        vectors.push({
          id: entry.id,
          embedding,
          norm: normalized ? 1 : computeNorm(embedding),
        });
      }

      if (!vectors.length) {
        return null;
      }

      const dims = Number.isFinite(parsed.dims) ? parsed.dims ?? vectors[0].embedding.length : vectors[0].embedding.length;

      return {
        model,
        normalized,
        dims,
        vectors,
      };
    } catch {
      return null;
    }
  })();

  return indexPromise;
}

async function getEmbedder(model: string) {
  if (embedderPromises.has(model)) {
    return embedderPromises.get(model)!;
  }
  const promise = (async () => {
    const { pipeline } = await import("@xenova/transformers");
    return pipeline("feature-extraction", model);
  })();
  embedderPromises.set(model, promise);
  return promise;
}

async function embedQuery(model: string, text: string): Promise<Float32Array> {
  const embedder = await getEmbedder(model);
  const output = await embedder(text, { pooling: "mean", normalize: true });
  const list = output.tolist();
  const vector = Array.isArray(list[0]) ? list[0] : list;
  return Float32Array.from(vector);
}

export async function semanticSearch(query: string, topK = 8): Promise<ScoredResult[]> {
  const trimmed = query.trim();
  if (!trimmed) {
    return [];
  }

  const index = await loadVectorIndex();
  if (!index || !index.vectors.length) {
    return [];
  }

  const queryVector = await embedQuery(index.model, trimmed);
  const queryNorm = index.normalized ? 1 : computeNorm(queryVector);

  const scored = index.vectors.map((vector) => ({
    id: vector.id,
    score: dotProduct(queryVector, vector.embedding) / (queryNorm * vector.norm),
  }));

  scored.sort((a, b) => b.score - a.score);
  return scored.slice(0, topK);
}

