const COLLAGE_ANCHORS = [
  { x: 0.2, y: 0.22, size: 8 },
  { x: 0.72, y: 0.18, size: 6 },
  { x: 0.17, y: 0.72, size: 5 },
  { x: 0.58, y: 0.68, size: 7 },
  { x: 0.38, y: 0.38, size: 4 },
];

const DRIFT_SPEED = 0.0012;
const DRIFT_DELAY_MS = 600;
const SCALE_RATIO = 0.32;
const TILE_GRID = 7;
const TILE_STROKE = [20, 22, 28, 90] as const;

export function createLandingSketch(p5: any, options: SketchOptions) {
  let rotationX = 0;
  let rotationY = 0;
  let targetX = 0;
  let targetY = 0;
  let dragging = false;
  let lastPointer = { x: 0, y: 0 };
  let lastInteraction = -DRIFT_DELAY_MS;
  let lastFaceId: FaceDefinition["id"] | null = null;
  let lastEmit = 0;
  const faceMap = FACE_REGISTRY.reduce<Record<FaceDefinition["id"], FaceDefinition>>(
    (acc, face) => {
      acc[face.id] = face;
      return acc;
    },
    {} as Record<FaceDefinition["id"], FaceDefinition>
  );

  function getParentWidth() {
    if (options.parent) {
      return options.parent.clientWidth || 360;
    }
    if (typeof window !== "undefined") {
      return window.innerWidth;
    }
    return 360;
  }

  const resizeCanvas = () => {
    const targetWidth = Math.max(320, Math.min(getParentWidth(), 760));
    const targetHeight = Math.max(320, targetWidth * 0.7);
    p5.resizeCanvas(targetWidth, targetHeight);
  };

  const updateRotation = () => {
    rotationX += (targetX - rotationX) * 0.08;
    rotationY += (targetY - rotationY) * 0.08;
    if (!dragging && p5.millis() - lastInteraction > DRIFT_DELAY_MS) {
      targetY += DRIFT_SPEED;
      targetX += DRIFT_SPEED * 0.6;
    }
  };

  const rotateVector = (vector: [number, number, number], rx: number, ry: number) => {
    const cosX = Math.cos(rx);
    const sinX = Math.sin(rx);
    const cosY = Math.cos(ry);
    const sinY = Math.sin(ry);
    const x = vector[0];
    const y = vector[1];
    const z = vector[2];
    const y1 = y * cosX - z * sinX;
    const z1 = y * sinX + z * cosX;
    const x2 = x * cosY + z1 * sinY;
    const z2 = -x * sinY + z1 * cosY;
    return { x: x2, y: y1, z: z2 };
  };

  const detectFrontFace = (rx: number, ry: number): FaceDefinition["id"] => {
    let bestFace: FaceDefinition["id"] = FACE_REGISTRY[0].id;
    let bestZ = -Infinity;
    FACE_STRUCTURES.forEach((face) => {
      const rotated = rotateVector(FACE_NORMALS[face.id], rx, ry);
      if (rotated.z > bestZ) {
        bestZ = rotated.z;
        bestFace = face.id;
      }
    });
    return bestFace;
  };

  const maybeReportFace = (faceId: FaceDefinition["id"]) => {
    const now = p5.millis();
    if (now - lastEmit < 110) {
      return;
    }
    lastEmit = now;
    if (faceId !== lastFaceId) {
      lastFaceId = faceId;
      options.onFaceChange(faceId);
    }
  };

  const rotatePoint = (point: Point3D, scale: number, rx: number, ry: number) => {
    const scaled = {
      x: point.x * scale,
      y: point.y * scale,
      z: point.z * scale,
    };
    const cosX = Math.cos(rx);
    const sinX = Math.sin(rx);
    const cosY = Math.cos(ry);
    const sinY = Math.sin(ry);
    const y1 = scaled.y * cosX - scaled.z * sinX;
    const z1 = scaled.y * sinX + scaled.z * cosX;
    const x2 = scaled.x * cosY + z1 * sinY;
    const z2 = -scaled.x * sinY + z1 * cosY;
    return { x: x2, y: y1, z: z2 };
  };

  const projectPoint = (point: Point3D, centerX: number, centerY: number) => {
    const depth = 720 / (720 - point.z);
    return {
      x: centerX + point.x * depth,
      y: centerY + point.y * depth,
      z: point.z,
    };
  };

  const drawBackground = (centerX: number, centerY: number, scale: number) => {
    p5.push();
    p5.noFill();
    p5.strokeWeight(1);
    p5.stroke(255, 20);
    p5.rectMode(p5.CENTER);
    for (let i = -1; i <= 1; i += 1) {
      const offset = i * 12;
      p5.rect(centerX + offset, centerY + offset, scale * 2.6, scale * 2.6);
    }
    p5.pop();

    p5.push();
    p5.noStroke();
    p5.fill(255, 16);
    COLLAGE_ANCHORS.forEach((anchor) => {
      p5.rectMode(p5.CENTER);
      p5.rect(
        centerX + (anchor.x - 0.5) * scale * 2.1,
        centerY + (anchor.y - 0.5) * scale * 2.1,
        anchor.size,
        anchor.size
      );
    });
    p5.pop();
  };

  const drawFace = (
    polygon: { x: number; y: number; z: number }[],
    faceId: FaceDefinition["id"],
    centroid: { x: number; y: number },
    frontFace: FaceDefinition["id"]
  ) => {
    const faceDef = faceMap[faceId];
    if (!faceDef) {
      return;
    }
    const isActive = faceId === frontFace;
    const alpha = isActive ? 225 : 200;
    const [p0, p1, p2, p3] = polygon;
    const edgeAlpha = isActive ? 140 : 90;

    const tileColorIndex = (tileIndex: number) => {
      const base =
        faceId.charCodeAt(0) * 31 +
        faceId.charCodeAt(1) * 17 +
        tileIndex * 131;
      return PALETTE_COLORS[base % PALETTE_COLORS.length] ?? "#f5f2f2";
    };

    const pointOnQuad = (

      a: { x: number; y: number },
      b: { x: number; y: number },
      c: { x: number; y: number },
      d: { x: number; y: number },
      u: number,
      v: number
    ) => {
      const ab = { x: p5.lerp(a.x, b.x, u), y: p5.lerp(a.y, b.y, u) };
      const dc = { x: p5.lerp(d.x, c.x, u), y: p5.lerp(d.y, c.y, u) };
      return { x: p5.lerp(ab.x, dc.x, v), y: p5.lerp(ab.y, dc.y, v) };
    };

    p5.stroke(...TILE_STROKE);
    p5.strokeWeight(0.7);

    for (let row = 0; row < TILE_GRID; row += 1) {
      for (let col = 0; col < TILE_GRID; col += 1) {
        const u0 = col / TILE_GRID;
        const v0 = row / TILE_GRID;
        const u1 = (col + 1) / TILE_GRID;
        const v1 = (row + 1) / TILE_GRID;
        const tileIndex = row * TILE_GRID + col;

        const c0 = pointOnQuad(p0, p1, p2, p3, u0, v0);
        const c1 = pointOnQuad(p0, p1, p2, p3, u1, v0);
        const c2 = pointOnQuad(p0, p1, p2, p3, u1, v1);
        const c3 = pointOnQuad(p0, p1, p2, p3, u0, v1);

        const color = p5.color(tileColorIndex(tileIndex));
        color.setAlpha(alpha);
        p5.fill(color);
        p5.beginShape();
        p5.vertex(c0.x, c0.y);
        p5.vertex(c1.x, c1.y);
        p5.vertex(c2.x, c2.y);
        p5.vertex(c3.x, c3.y);
        p5.endShape(p5.CLOSE);
      }
    }

    p5.stroke(faceDef.palette.border);
    p5.strokeWeight(1.6);
    p5.noFill();
    p5.beginShape();
    polygon.forEach((vertex) => {
      p5.vertex(vertex.x, vertex.y);
    });
    p5.endShape(p5.CLOSE);

    const accentColor = p5.color(faceDef.palette.accent);
    accentColor.setAlpha(edgeAlpha);
    p5.stroke(accentColor);
    p5.strokeWeight(1.3);
    p5.beginShape();
    polygon.slice(0, 3).forEach((vertex) => {
      p5.vertex(vertex.x, vertex.y);
    });
    p5.endShape();

    p5.push();
    p5.noStroke();
    const accentFill = p5.color(faceDef.palette.accent);
    accentFill.setAlpha(edgeAlpha);
    p5.fill(accentFill);
    p5.rectMode(p5.CENTER);
    p5.rect(centroid.x, centroid.y - 7, 22, 3);
    p5.rect(centroid.x - 12, centroid.y + 5, 6, 6);
    p5.rect(centroid.x + 10, centroid.y + 6, 4, 4);
    p5.pop();
  };

  p5.setup = () => {
    const initialWidth = Math.max(320, Math.min(getParentWidth(), 760));
    const initialHeight = Math.max(320, initialWidth * 0.7);
    const canvas = p5.createCanvas(initialWidth, initialHeight);
    canvas.parent(options.parent ?? document.body);
    canvas.style("display", "block");
    p5.pixelDensity(1);
    p5.textFont("Space Grotesk, IBM Plex Sans, system-ui");
    p5.noSmooth();
  };

  p5.windowResized = () => {
    resizeCanvas();
  };

  p5.mousePressed = () => {
    dragging = true;
    lastPointer = { x: p5.mouseX, y: p5.mouseY };
    lastInteraction = p5.millis();
  };

  p5.mouseDragged = () => {
    if (!dragging) {
      return false;
    }
    const dx = p5.mouseX - lastPointer.x;
    const dy = p5.mouseY - lastPointer.y;
    targetY += dx * 0.008;
    targetX += dy * 0.008;
    lastPointer = { x: p5.mouseX, y: p5.mouseY };
    lastInteraction = p5.millis();
    return false;
  };

  p5.mouseReleased = () => {
    dragging = false;
  };

  p5.touchStarted = p5.mousePressed;
  p5.touchMoved = p5.mouseDragged;
  p5.touchEnded = p5.mouseReleased;

  p5.draw = () => {
    p5.clear();
    const centerX = p5.width / 2;
    const centerY = p5.height / 2;
    const scale = Math.min(p5.width, p5.height) * SCALE_RATIO;

    drawBackground(centerX, centerY, scale);
    updateRotation();
    if (options.onRotationChange) {
      options.onRotationChange(rotationX, rotationY);
    }

    const rotated = BASE_VERTICES.map((vertex) => rotatePoint(vertex, scale, rotationX, rotationY));
    const projected = rotated.map((vertex) => projectPoint(vertex, centerX, centerY));
    const frontFace = detectFrontFace(rotationX, rotationY);

    const faceEntries = FACE_STRUCTURES.map((face) => {
      const polygon = face.indices.map((index) => projected[index]);
      const depth = polygon.reduce((sum, pnt) => sum + pnt.z, 0) / polygon.length;
      const centroid = {
        x: polygon.reduce((sum, pnt) => sum + pnt.x, 0) / polygon.length,
        y: polygon.reduce((sum, pnt) => sum + pnt.y, 0) / polygon.length,
      };
      return { faceId: face.id, polygon, depth, centroid };
    });

    faceEntries
      .sort((a, b) => a.depth - b.depth)
      .forEach((entry) => drawFace(entry.polygon, entry.faceId, entry.centroid, frontFace));

    maybeReportFace(frontFace);
  };
}

import { getTrustedClientIp } from "../../_lib/request";
import { checkTokenBucket } from "../../_lib/rateLimit";

export const dynamic = "force-dynamic";

const DEFAULT_MAX_BODY_BYTES = 64 * 1024;
const DEFAULT_RATE_LIMIT = 30;
const DEFAULT_RATE_WINDOW_SECONDS = 60;
const MAX_REPORTS = 20;
const MAX_FIELD_LENGTH = 512;

const ALLOWED_CONTENT_TYPES = new Set([
  "application/csp-report",
  "application/reports+json",
  "application/json",
]);

function parsePositiveInt(value: string | undefined, fallback: number, min: number, max: number) {
  if (!value) {
    return fallback;
  }
  const parsed = Number.parseInt(value, 10);
  if (!Number.isFinite(parsed)) {
    return fallback;
  }
  return Math.min(Math.max(parsed, min), max);
}

function getConfig() {
  const maxBodyBytes = parsePositiveInt(
    process.env.CSP_REPORT_MAX_BYTES,
    DEFAULT_MAX_BODY_BYTES,
    1024,
    1024 * 1024
  );
  const limit = parsePositiveInt(
    process.env.CSP_REPORT_RATE_LIMIT,
    DEFAULT_RATE_LIMIT,
    1,
    500
  );
  const windowSeconds = parsePositiveInt(
    process.env.CSP_REPORT_RATE_WINDOW_SECONDS,
    DEFAULT_RATE_WINDOW_SECONDS,
    1,
    3600
  );

  return {
    maxBodyBytes,
    limit,
    windowMs: windowSeconds * 1000,
  };
}

function normalizeContentType(contentType: string | null) {
  if (!contentType) {
    return null;
  }
  return contentType.split(";")[0]?.trim().toLowerCase() ?? null;
}

function safeString(value: unknown) {
  if (typeof value !== "string") {
    return undefined;
  }
  const trimmed = value.trim();
  if (!trimmed) {
    return undefined;
  }
  return trimmed.length > MAX_FIELD_LENGTH ? trimmed.slice(0, MAX_FIELD_LENGTH) : trimmed;
}

function sanitizeUrl(value: unknown) {
  const raw = safeString(value);
  if (!raw) {
    return undefined;
  }
  try {
    const url = new URL(raw);
    if (url.protocol !== "http:" && url.protocol !== "https:") {
      return url.protocol;
    }
    url.search = "";
    url.hash = "";
    return `${url.origin}${url.pathname}`;
  } catch {
    return raw.length > MAX_FIELD_LENGTH ? raw.slice(0, MAX_FIELD_LENGTH) : raw;
  }
}

function coerceNumber(value: unknown) {
  if (typeof value === "number" && Number.isFinite(value)) {
    return value;
  }
  if (typeof value === "string") {
    const parsed = Number.parseInt(value, 10);
    if (Number.isFinite(parsed)) {
      return parsed;
    }
  }
  return undefined;
}

function getField(report: Record<string, unknown>, keys: string[]) {
  for (const key of keys) {
    if (key in report) {
      return report[key];
    }
  }
  return undefined;
}

function extractReports(payload: unknown): Array<Record<string, unknown>> {
  if (!payload) {
    return [];
  }
  if (Array.isArray(payload)) {
    return payload
      .map((entry) => {
        if (!entry || typeof entry !== "object") {
          return null;
        }
        const body = (entry as Record<string, unknown>).body;
        if (body && typeof body === "object") {
          return body as Record<string, unknown>;
        }
        return null;
      })
      .filter(Boolean) as Array<Record<string, unknown>>;
  }
  if (typeof payload === "object") {
    const report = (payload as Record<string, unknown>)["csp-report"];
    if (report && typeof report === "object") {
      return [report as Record<string, unknown>];
    }
    const body = (payload as Record<string, unknown>).body;
    if (body && typeof body === "object") {
      return [body as Record<string, unknown>];
    }
  }
  return [];
}

function sanitizeReport(report: Record<string, unknown>) {
  return {
    documentUri: sanitizeUrl(getField(report, ["document-uri", "documentUri"])),
    referrer: sanitizeUrl(getField(report, ["referrer"])),
    blockedUri: sanitizeUrl(getField(report, ["blocked-uri", "blockedUri"])),
    effectiveDirective: safeString(
      getField(report, ["effective-directive", "effectiveDirective"])
    ),
    violatedDirective: safeString(
      getField(report, ["violated-directive", "violatedDirective"])
    ),
    sourceFile: sanitizeUrl(getField(report, ["source-file", "sourceFile"])),
    lineNumber: coerceNumber(getField(report, ["line-number", "lineNumber"])),
    columnNumber: coerceNumber(getField(report, ["column-number", "columnNumber"])),
    disposition: safeString(getField(report, ["disposition"])),
    statusCode: coerceNumber(getField(report, ["status-code", "statusCode"])),
  };
}

function noContent() {
  return new Response(null, {
    status: 204,
    headers: {
      "Cache-Control": "no-store",
    },
  });
}

export async function POST(request: Request) {
  const { maxBodyBytes, limit, windowMs } = getConfig();
  const contentType = normalizeContentType(request.headers.get("content-type"));
  if (!contentType || !ALLOWED_CONTENT_TYPES.has(contentType)) {
    return noContent();
  }

  const contentLength = request.headers.get("content-length");
  if (contentLength) {
    const length = Number.parseInt(contentLength, 10);
    if (Number.isFinite(length) && length > maxBodyBytes) {
      return noContent();
    }
  }

  const clientKey = `csp:${getTrustedClientIp(request)}`;
  const rate = await checkTokenBucket(clientKey, limit, windowMs);
  if (!rate.allowed) {
    return noContent();
  }

  let payloadText = "";
  try {
    payloadText = await request.text();
  } catch {
    return noContent();
  }

  if (payloadText.length > maxBodyBytes) {
    return noContent();
  }

  let payload: unknown;
  try {
    payload = JSON.parse(payloadText);
  } catch {
    return noContent();
  }

  const reports = extractReports(payload).slice(0, MAX_REPORTS);
  if (reports.length) {
    const sanitizedReports = reports.map(sanitizeReport);
    console.log(
      JSON.stringify({
        event: "csp-report",
        count: sanitizedReports.length,
        reports: sanitizedReports,
      })
    );
  }

  return noContent();
}

import { NextResponse } from "next/server";
import { randomUUID } from "node:crypto";
import { promises as fs } from "node:fs";
import path from "node:path";

import { hybridSearch } from "../../_lib/kb";
import { getTrustedClientIp } from "../../_lib/request";
import { checkTokenBucket, getHelpdeskRateLimitConfig } from "../../_lib/rateLimit";

export const dynamic = "force-dynamic";

type HelpRequest = {
  message?: string;
  diagnostics?: Record<string, unknown> | null;
};

type Citation = {
  id: string;
  path: string;
  startLine: number;
  endLine: number;
  score: number;
};

type ContextChunk = Citation & {
  text: string;
};

const DEFAULT_TOP_K = 8;
const DEFAULT_MAX_BODY_BYTES = 16 * 1024;
const DEFAULT_MAX_TOKENS = 700;
const MAX_BODY_BYTES = parsePositiveInt(
  process.env.HELPDESK_MAX_BODY_BYTES,
  DEFAULT_MAX_BODY_BYTES,
  1024,
  256 * 1024
);
const MAX_LLM_TOKENS = parsePositiveInt(
  process.env.HELPDESK_LLM_MAX_TOKENS,
  DEFAULT_MAX_TOKENS,
  64,
  4096
);

let helpdeskRulesPromise: Promise<string> | null = null;

function parsePositiveInt(
  raw: string | undefined,
  fallback: number,
  min: number,
  max: number
): number {
  if (!raw) {
    return fallback;
  }
  const parsed = Number.parseInt(raw, 10);
  if (!Number.isFinite(parsed)) {
    return fallback;
  }
  return Math.min(Math.max(parsed, min), max);
}

function getHelpdeskConfig() {
  const apiKey = process.env.HELPDESK_LLM_API_KEY ?? process.env.OPENAI_API_KEY ?? "";
  const baseUrl = process.env.HELPDESK_LLM_BASE_URL ?? "https://api.openai.com/v1";
  const model = process.env.HELPDESK_LLM_MODEL ?? "gpt-4o-mini";
  return { apiKey, baseUrl, model, maxTokens: MAX_LLM_TOKENS };
}

async function loadHelpdeskRules(): Promise<string> {
  if (helpdeskRulesPromise) {
    return helpdeskRulesPromise;
  }

  helpdeskRulesPromise = (async () => {
    const filePath = path.join(process.cwd(), "agents-helpdesk.md");
    return fs.readFile(filePath, "utf8");
  })();

  return helpdeskRulesPromise;
}

function buildContext(citations: ContextChunk[]): string {
  if (!citations.length) {
    return "[context/none:1-1]\nNo relevant context found in the knowledge base.";
  }

  return citations
    .map((citation) => {
      return `[${citation.path}:${citation.startLine}-${citation.endLine}]\n${citation.text}`;
    })
    .join("\n\n");
}

function extractConfidence(answer: string): "high" | "medium" | "low" {
  const match = answer.match(/confidence\**:\s*(high|medium|low)/i);
  if (!match) {
    return "low";
  }
  const value = match[1].toLowerCase();
  if (value === "high" || value === "medium") {
    return value;
  }
  return "low";
}

async function callLlm(systemPrompt: string, userPrompt: string): Promise<string> {
  const { apiKey, baseUrl, model, maxTokens } = getHelpdeskConfig();
  if (!apiKey) {
    throw new Error("missing_llm_api_key");
  }

  const response = await fetch(`${baseUrl.replace(/\/$/, "")}/chat/completions`, {
    method: "POST",
    headers: {
      Authorization: `Bearer ${apiKey}`,
      "Content-Type": "application/json",
    },
    body: JSON.stringify({
      model,
      temperature: 0.2,
      max_tokens: maxTokens,
      messages: [
        { role: "system", content: systemPrompt },
        { role: "user", content: userPrompt },
      ],
    }),
  });

  if (!response.ok) {
    const detail = await response.text();
    throw new Error(`llm_request_failed:${response.status}:${detail}`);
  }

  const payload = (await response.json()) as {
    choices?: Array<{ message?: { content?: string } }>;
  };
  const content = payload?.choices?.[0]?.message?.content;
  if (!content) {
    throw new Error("llm_response_empty");
  }
  return content;
}

async function readBodyWithLimit(request: Request, maxBytes: number): Promise<string> {
  const contentLength = request.headers.get("content-length");
  if (contentLength) {
    const length = Number.parseInt(contentLength, 10);
    if (Number.isFinite(length) && length > maxBytes) {
      throw new Error("body_too_large");
    }
  }

  const reader = request.body?.getReader();
  if (!reader) {
    const text = await request.text();
    const bytes = new TextEncoder().encode(text).length;
    if (bytes > maxBytes) {
      throw new Error("body_too_large");
    }
    return text;
  }

  const chunks: Uint8Array[] = [];
  let total = 0;
  while (true) {
    const { done, value } = await reader.read();
    if (done) {
      break;
    }
    if (!value) {
      continue;
    }
    total += value.length;
    if (total > maxBytes) {
      await reader.cancel();
      throw new Error("body_too_large");
    }
    chunks.push(value);
  }

  const buffer = new Uint8Array(total);
  let offset = 0;
  for (const chunk of chunks) {
    buffer.set(chunk, offset);
    offset += chunk.length;
  }

  return new TextDecoder().decode(buffer);
}

export async function POST(request: Request) {
  const requestId = randomUUID();
  const startedAt = Date.now();
  const logRequest = (status: number) => {
    const durationMs = Date.now() - startedAt;
    console.log(
      JSON.stringify({
        requestId,
        status,
        durationMs,
      })
    );
  };

  let rawBody = "";
  try {
    rawBody = await readBodyWithLimit(request, MAX_BODY_BYTES);
  } catch {
    logRequest(413);
    return NextResponse.json({ error: "body_too_large" }, { status: 413 });
  }

  let body: HelpRequest;
  try {
    body = JSON.parse(rawBody) as HelpRequest;
  } catch {
    logRequest(400);
    return NextResponse.json({ error: "invalid_json" }, { status: 400 });
  }

  const message = typeof body.message === "string" ? body.message.trim() : "";
  if (!message) {
    logRequest(400);
    return NextResponse.json({ error: "missing_message" }, { status: 400 });
  }

  const diagnostics =
    body.diagnostics && typeof body.diagnostics === "object" ? body.diagnostics : null;

  const { limit, windowMs } = getHelpdeskRateLimitConfig();
  const clientKey = `helpdesk:${getTrustedClientIp(request)}`;
  const rate = await checkTokenBucket(clientKey, limit, windowMs);
  if (!rate.allowed) {
    logRequest(429);
    return NextResponse.json(
      { error: "rate_limited", resetAt: rate.resetAt },
      {
        status: 429,
        headers: {
          "Retry-After": Math.ceil((rate.resetAt - Date.now()) / 1000).toString(),
        },
      }
    );
  }

  try {
    const results = await hybridSearch(message, DEFAULT_TOP_K);
    const citations: ContextChunk[] = results.map((result) => ({
      id: result.entry.id,
      path: result.entry.path,
      startLine: result.entry.startLine,
      endLine: result.entry.endLine,
      score: result.score,
      text: result.entry.text,
    }));

    const rules = await loadHelpdeskRules();
    const context = buildContext(citations);
    const systemPrompt = `${rules}\n\nRetrieved context:\n${context}`;

    let userPrompt = `User message:\n${message}`;
    if (diagnostics) {
      userPrompt += `\n\nDiagnostics:\n${JSON.stringify(diagnostics, null, 2)}`;
    }

    const answer = await callLlm(systemPrompt, userPrompt);
    const confidence = extractConfidence(answer);

    logRequest(200);
    return NextResponse.json({
      answer,
      citations: citations.map(({ text: _text, ...rest }) => rest),
      confidence,
    });
  } catch (error) {
    const message = error instanceof Error ? error.message : String(error);
    logRequest(500);
    return NextResponse.json({ error: "help_failed", detail: message }, { status: 500 });
  }
}

import { NextResponse } from "next/server";

import { getEnvConfig } from "../../../_lib/env";
import { getTrustedClientIp } from "../../../_lib/request";
import { checkTokenBucket, getReadRateLimitConfig } from "../../../_lib/rateLimit";
import {
  getAllNftsForCollection,
  getNftsForCollection,
} from "../../../_lib/alchemy";

export const dynamic = "force-dynamic";

export async function GET(request: Request) {
  try {
    const { limit: readLimit, windowMs } = getReadRateLimitConfig();
    const clientKey = `read:${new URL(request.url).pathname}:${getTrustedClientIp(
      request
    )}`;
    const rate = await checkTokenBucket(clientKey, readLimit, windowMs);
    if (!rate.allowed) {
      return NextResponse.json(
        { error: "rate_limited", resetAt: rate.resetAt },
        {
          status: 429,
          headers: {
            "Retry-After": Math.ceil((rate.resetAt - Date.now()) / 1000).toString(),
          },
        }
      );
    }

    const url = new URL(request.url);
    const { searchParams } = url;
    const chainIdParam = searchParams.get("chainId");
    const chainIdRaw = chainIdParam ? Number.parseInt(chainIdParam, 10) : NaN;
    const chainId = Number.isFinite(chainIdRaw) ? chainIdRaw : undefined;
    const { network, contractAddress } = getEnvConfig(chainId);
    const limitParam = searchParams.get("limit");
    const pageKeyParam = searchParams.get("pageKey");
    const allParam = searchParams.get("all");
    const maxPagesParam = searchParams.get("maxPages");
    const parsedLimit = limitParam ? Number.parseInt(limitParam, 10) : 20;
    const limit = Number.isFinite(parsedLimit) ? parsedLimit : 20;
    const all = allParam === "1" || allParam === "true";
    const parsedMaxPages = maxPagesParam
      ? Number.parseInt(maxPagesParam, 10)
      : 10;
    const maxPages = Number.isFinite(parsedMaxPages) ? parsedMaxPages : 10;

    const pageKey =
      pageKeyParam && pageKeyParam.trim().length > 0 ? pageKeyParam : undefined;
    const result = all
      ? await getAllNftsForCollection({ pageSize: limit, maxPages, chainId })
      : await getNftsForCollection(limit, pageKey, chainId);

    return NextResponse.json({
      network,
      contractAddress,
      count: result.tokens.length,
      tokens: result.tokens,
      pageKey: result.pageKey ?? null,
      nextToken: result.pageKey ?? null,
      pages: "pages" in result ? result.pages : 1,
      truncated: "truncated" in result ? result.truncated : false,
      mode: all ? "all" : "page",
    });
  } catch (error) {
    const message = error instanceof Error ? error.message : "token_list_failed";
    return NextResponse.json({ error: message }, { status: 500 });
  }
}

import { NextResponse } from "next/server";

import { getCachedJson } from "../../../../_lib/cache";
import { getEnvConfig } from "../../../../_lib/env";
import { getNftMetadata, getOwnersForToken } from "../../../../_lib/alchemy";
import { normalizeTokenId } from "../../../../_lib/normalize";
import { getTrustedClientIp } from "../../../../_lib/request";
import { checkTokenBucket, getReadRateLimitConfig } from "../../../../_lib/rateLimit";
import {
  resolveMetadata,
  resolveMetadataFromObject,
} from "../../../../_lib/metadata";
import {
  buildOwnerOverlapEvidence,
  buildProvenanceCandidates,
  buildSameTransactionEvidence,
  scanMetadataReferences,
} from "../../../../_lib/provenance";
import { getMintedTokenIdsFromReceipt } from "../../../../_lib/ethers";

// GET /api/token/:id/provenance returns counts, mintTxHash, disclaimer, and other metadata besides candidates.
export const dynamic = "force-dynamic";

export async function GET(
  request: Request,
  { params }: { params: { id: string } }
) {
  const tokenId = normalizeTokenId(params.id);
  if (!tokenId) {
    return NextResponse.json({ error: "invalid_token_id" }, { status: 400 });
  }

  const url = new URL(request.url);
  const chainIdParam = url.searchParams.get("chainId");
  const chainIdRaw = chainIdParam ? Number.parseInt(chainIdParam, 10) : NaN;
  const chainId = Number.isFinite(chainIdRaw) ? chainIdRaw : undefined;

  const { limit: readLimit, windowMs } = getReadRateLimitConfig();
  const clientKey = `read:${new URL(request.url).pathname}:${getTrustedClientIp(
    request
  )}`;
  const rate = await checkTokenBucket(clientKey, readLimit, windowMs);
  if (!rate.allowed) {
    return NextResponse.json(
      { error: "rate_limited", resetAt: rate.resetAt },
      {
        status: 429,
        headers: {
          "Retry-After": Math.ceil((rate.resetAt - Date.now()) / 1000).toString(),
        },
      }
    );
  }

  const { contractAddress, network, cacheTtls } = getEnvConfig(chainId);
  const cacheKey = `provenance:${tokenId}:${chainId ?? "default"}`;

  try {
    const payload = await getCachedJson(cacheKey, cacheTtls.provenance, async () => {
      const token = await getNftMetadata(tokenId, chainId);
      const resolvedMetadata = token.tokenUri?.raw
        ? await resolveMetadata(tokenId, token.tokenUri.raw, cacheTtls.metadata)
        : resolveMetadataFromObject(tokenId, token.metadata);

      const metadataSource = resolvedMetadata.metadata ?? token.metadata;
      const metadataReferences = scanMetadataReferences(metadataSource);

      let sameTransactionReferences = new Map();
      let mintedTokenIds: string[] = [];

      if (token.mint?.transactionHash) {
        mintedTokenIds = await getMintedTokenIdsFromReceipt(
          token.mint.transactionHash,
          chainId
        );
        sameTransactionReferences = buildSameTransactionEvidence(
          token.mint.transactionHash,
          mintedTokenIds,
          tokenId
        );
      }

      const candidateIds = new Set<string>([
        ...metadataReferences.keys(),
        ...sameTransactionReferences.keys(),
      ]);

      const targetOwners = await getOwnersForToken(tokenId, chainId);
      const ownerOverlap = new Map();

      await Promise.all(
        Array.from(candidateIds).map(async (candidateId) => {
          if (candidateId === tokenId) {
            return;
          }
          try {
            const candidateOwners = await getOwnersForToken(candidateId, chainId);
            const overlap = buildOwnerOverlapEvidence(targetOwners, candidateOwners);
            if (overlap) {
              ownerOverlap.set(candidateId, overlap);
            }
          } catch {
            // Ignore invalid candidate ids or transient owner lookup failures.
          }
        })
      );

      const candidates = buildProvenanceCandidates({
        targetTokenId: tokenId,
        metadataReferences,
        sameTransactionReferences,
        ownerOverlap,
      });

      // /api/token/:id/provenance returns metadata counts, mintTxHash, disclaimer, and candidates.
      return {
        tokenId,
        contractAddress,
        network,
        mintTxHash: token.mint?.transactionHash ?? null,
        metadataReferenceCount: metadataReferences.size,
        sameTransactionCount: sameTransactionReferences.size,
        ownerOverlapCount: ownerOverlap.size,
        candidates,
        disclaimer:
          "Provenance is heuristic and may be incomplete or incorrect; treat results as inferred evidence, not certainty.",
      };
    });

    return NextResponse.json(payload);
  } catch (error) {
    const message = error instanceof Error ? error.message : String(error);
    return NextResponse.json({ error: "provenance_lookup_failed", detail: message }, { status: 500 });
  }
}

import { NextResponse } from "next/server";

import { getEnvConfig } from "../../../_lib/env";
import { getNftMetadata } from "../../../_lib/alchemy";
import { normalizeAddress, normalizeTokenId } from "../../../_lib/normalize";
import { getTrustedClientIp } from "../../../_lib/request";
import { checkTokenBucket, getReadRateLimitConfig } from "../../../_lib/rateLimit";
import {
  resolveMetadata,
  resolveMetadataFromObject,
} from "../../../_lib/metadata";

export const dynamic = "force-dynamic";

export async function GET(
  request: Request,
  { params }: { params: { id: string } }
) {
  const tokenId = normalizeTokenId(params.id);
  if (!tokenId) {
    return NextResponse.json({ error: "invalid_token_id" }, { status: 400 });
  }

  const url = new URL(request.url);
  const chainIdParam = url.searchParams.get("chainId");
  const chainIdRaw = chainIdParam ? Number.parseInt(chainIdParam, 10) : NaN;
  const chainId = Number.isFinite(chainIdRaw) ? chainIdRaw : undefined;

  const { limit: readLimit, windowMs } = getReadRateLimitConfig();
  const clientKey = `read:${new URL(request.url).pathname}:${getTrustedClientIp(
    request
  )}`;
  const rate = await checkTokenBucket(clientKey, readLimit, windowMs);
  if (!rate.allowed) {
    return NextResponse.json(
      { error: "rate_limited", resetAt: rate.resetAt },
      {
        status: 429,
        headers: {
          "Retry-After": Math.ceil((rate.resetAt - Date.now()) / 1000).toString(),
        },
      }
    );
  }

  const { contractAddress, network, cacheTtls } = getEnvConfig(chainId);

  try {
    const token = await getNftMetadata(tokenId, chainId);
    const normalizedContract = normalizeAddress(contractAddress);

    if (
      normalizedContract &&
      normalizeAddress(token.contractAddress) !== normalizedContract
    ) {
      return NextResponse.json(
        { error: "token_not_in_contract" },
        { status: 400 }
      );
    }

    let resolvedMetadata = token.tokenUri?.raw
      ? await resolveMetadata(tokenId, token.tokenUri.raw, cacheTtls.metadata)
      : resolveMetadataFromObject(tokenId, token.metadata);
    if (!resolvedMetadata.metadata) {
      resolvedMetadata = resolveMetadataFromObject(tokenId, token.metadata);
    }

    return NextResponse.json({
      tokenId,
      contractAddress,
      network,
      title: token.title,
      name: token.name,
      description: token.description,
      tokenUri: token.tokenUri,
      media: token.media,
      mint: token.mint,
      metadata: {
        raw: token.metadata,
        resolved: resolvedMetadata.metadata,
        resolvedUrl: resolvedMetadata.resolvedUrl,
        media: resolvedMetadata.media,
        validation: resolvedMetadata.validation,
      },
    });
  } catch (error) {
    const message = error instanceof Error ? error.message : String(error);
    const status = message.includes("404") ? 404 : 500;
    return NextResponse.json({ error: "token_lookup_failed", detail: message }, { status });
  }
}

import { NextResponse } from "next/server";

import { getEnvConfig } from "../../../../_lib/env";
import { normalizeTokenId } from "../../../../_lib/normalize";
import { readOwnerOf, readTokenUri } from "../../../../_lib/ethers";
import { getTrustedClientIp } from "../../../../_lib/request";
import { checkRateLimit, getVerifyRateLimitConfig } from "../../../../_lib/rateLimit";

export const dynamic = "force-dynamic";

export async function POST(
  request: Request,
  { params }: { params: { id: string } }
) {
  const tokenId = normalizeTokenId(params.id);
  if (!tokenId) {
    return NextResponse.json({ error: "invalid_token_id" }, { status: 400 });
  }

  const url = new URL(request.url);
  const chainIdParam = url.searchParams.get("chainId");
  const chainIdRaw = chainIdParam ? Number.parseInt(chainIdParam, 10) : NaN;
  const chainId = Number.isFinite(chainIdRaw) ? chainIdRaw : undefined;

  const { contractAddress, network } = getEnvConfig(chainId);
  const { limit, windowMs } = getVerifyRateLimitConfig();
  const clientKey = `verify:${getTrustedClientIp(request)}`;
  const rate = await checkRateLimit(clientKey, limit, windowMs);

  if (!rate.allowed) {
    return NextResponse.json(
      { error: "rate_limited", resetAt: rate.resetAt },
      {
        status: 429,
        headers: {
          "Retry-After": Math.ceil((rate.resetAt - Date.now()) / 1000).toString(),
        },
      }
    );
  }

  try {
    const [owner, tokenUri] = await Promise.all([
      readOwnerOf(tokenId, chainId),
      readTokenUri(tokenId, chainId),
    ]);

    return NextResponse.json({
      tokenId,
      contractAddress,
      network,
      owner,
      tokenUri,
      verified: true,
      readOnly: true,
    });
  } catch (error) {
    const message = error instanceof Error ? error.message : String(error);
    const status = message.toLowerCase().includes("nonexistent") ? 404 : 500;

    return NextResponse.json(
      {
        tokenId,
        contractAddress,
        network,
        verified: false,
        readOnly: true,
        error: "verification_failed",
        detail: message,
      },
      { status }
    );
  }
}

